  false,\n\t\"url\": null,\n\t\"notes\": \"U.S. Monthly Climate Normals (1971-2000)
  is archived at the National Climatic Data Center (NCDC). DSI-9641C include climatological
  normals based on monthly maximum, minimum, and mean temperature and monthly total
  precipitation records for each year in the 30-year period 1971-2000. DSI-9641G include
  climatological normals based on monthly and annual heating and cooling degree days.
  In order to be included in the normals, a station had to have at least 10 years
  of monthly temperature data or 10 years of monthly precipitation data for each month
  in the period 1971-2000. In addition, a station had to be active since January 1,
  1999, or had to be included as a normals station in the 1961-1990 normals. This
  product includes normals of average monthly and annual maximum, minimum and mean
  temperature (degree F), monthly and annual total precipitation (inches), and heating
  and cooling degree days (base 65 degrees F).\",\n\t\"license_title\": null,\n\t\"extras\":
